const Contact = () => {
  return (
    <>
      <div className="">
        <p className="">Name</p>
        <input type="text" name="your-name" />
      </div>
      <div className="">
        <p className="">Mail</p>
        <input type="email" name="your-email" />
      </div>
      <div className="">
        <p className="">Message</p>
        <textarea type="text" name="message"></textarea>
      </div>
      <input type="submit"></input>
    </>
  );
};
export default Contact;
